= Applications =

As you've learned from the [[Programming feature>>Features.Programming]] it's possible to put code inside XWiki pages. You can combine several pages together to form an application. In other words an application is simply a self-contained set of XWiki pages. You can export these pages into a single archive file named a XAR (it stands for XWiki Archive) which can then be imported again into other wikis. This is a very nice way to create reusable applications.

Applications offer a powerful way to create advanced content within wiki pages.

== List of Applications available for download on XWiki.org ==

Check the [[Extensions wiki>>extensions:Main.WebHome]] which lists all applications available that you can install in your wiki.

