== Creating new Applications and Extensions ==

If you'd like to create new applications with XWiki our [[Developer's Guide>>DevGuide.WebHome]] will help you through the process.
If you are interested in participating to the XWiki project development itself or in building it from sources, you should refer to the [[XWiki development community>>dev:Main.WebHome]].
If you still have questions you may [[subscribe to the mailing lists>>dev:Community.MailingLists]].
